import React from "react";
import { Link } from "react-router-dom";
import "./RotaCard.css";

function RotaCard({ rota }) {
  return (
    <div className="rota-card">
      <h3>{rota.nome}</h3>
      <p>{rota.descricao}</p>
      <Link to={`/details/${rota.id}`} className="details-link">
        Ver detalhes
      </Link>
    </div>
  );
}

export default RotaCard;
